import getTokenApi from "./getTokenApi.js";
import axios from "axios";
import "dotenv/config";

async function asignarProceso(representante_legal,cedula_representante_legal,correo,numero_celular) {

  const jsonBody = {
    sendCompletionNotification: true,
    emailForNotification: "juan.munoz@affi.net",
    processes: [
      {
        enterpriseId: "9000533702",
        senderEmail: "juan.munoz@affi.net",
        senderIdentification: "1109184891",
        signers: [
          {
            name: representante_legal,
            documentType: "CC",
            identification: cedula_representante_legal,
            email: correo,
            phone: numero_celular,
            role: "SIGNER",
            authMethods: ["OTP"],
          },
        ],
        documents: [
          {
            content: "",
            fileName: "test.pdf",
          },
        ],
        subject: "Prueba SIGNER",
        message: "Buen día, remito documento de prueba de firmFa.",
        order: "", // Cambiado a booleano
        expirationDate: "", // Fecha de expiración válida
      },
    ],
  };

  try {
  
    const token = await getTokenApi();

    if (!token || typeof token !== "string") {
      throw new Error("No se pudo obtener un token válido.");
    }
    const END_POINT_CARGAR_PROCESO_API_AUTENTIC = process.env.END_POINT_API_AUTNETIC_SIGN;
    const processResponse = await axios.post(
      END_POINT_CARGAR_PROCESO_API_AUTENTIC,
      jsonBody,
      {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      }
    );
    const massiveProcessingId = processResponse.data.body.massiveProcessingId;
    
    return massiveProcessingId;

  } catch (error) {
    console.error("Error al asignar el utils:", error.message);
    throw error; 
  }
}

export default asignarProceso;
